// src/components/Header.tsx
import React from 'react';

const Header: React.FC = () => {
  return (
    <header className="header">
      <div style={{width: 1440, height: 122, position: 'relative', background: '#FFE3F7'}}>
        <div style={{width: 1102, height: 122, left: 163, top: 0, position: 'absolute'}}>
        <div style={{left: 277, top: 51, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '400', lineHeight: 22, wordWrap: 'break-word'}}>Home</div>
        <div style={{left: 480, top: 50, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '400', lineHeight: 22, wordWrap: 'break-word'}}>Plan</div>
        <div style={{left: 663, top: 50, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '400', lineHeight: 22, wordWrap: 'break-word'}}>MyPage</div>
        <div style={{left: 875, top: 50, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '400', lineHeight: 22, wordWrap: 'break-word'}}>Community</div>
        </div>
        <img style={{width: 90, height: 80, left: 73, top: 21, position: 'absolute', borderRadius: 85}} src="../assets/styles/Header_image/Logo.png"  alt=""/>
        <div style={{width: 76, height: 77, left: 1318, top: 36, position: 'absolute'}}>
        <div style={{width: 76, height: 72.79, left: 0, top: 0, position: 'absolute', background: '#D9D9D9', borderRadius: 9999}} />
        <img style={{width: 54.74, height: 63.59, left: 10.63, top: 13.41, position: 'absolute'}} src="../assets/styles/Header_image/myimage.png" alt="" />
        </div>
        </div>
    </header>
  );
};

export default Header;
